import ProductItem from "./ProductItems";
import "./products.css";
function Product() {
    const date=new Date();
const fullName="Yaprak Sarma";
const price="29 TL";
const yurl="data:image/jpeg;base64,"


  return (
   <div className="total"> 
    <h1>Products</h1>
     <div className="products">
      <ProductItem fullName={fullName} price={price} yurl={yurl} />
      <ProductItem fullName="Kuzu Pirzola" price="11₺" yurl="data:image/jpeg;base64,"/> 
      <ProductItem fullName="Yağlama" price="38₺" yurl="data:image/jpeg;base64,"/>
      <ProductItem/>
      <ProductItem/>
      <ProductItem/>
      <ProductItem/>
      <ProductItem/>
      <ProductItem/>
      <ProductItem/>
      <ProductItem/>
      <ProductItem/>
      <ProductItem/>
      <ProductItem/>
      <ProductItem/>
      <ProductItem/>
      <ProductItem/>
      <ProductItem/>
      <ProductItem/>
      <ProductItem/>
      <ProductItem/>
      <ProductItem/>
      <ProductItem/>
      <ProductItem/>
    </div>
    <span>{date.toISOString()}</span>

   </div>
  );
}

export default Product ;
